    useEffect(() => {
        getConfidence()
        console.log("useEffect")
    }, [])

    console.log("listOfQuotes", listOfQuotes)

    return (
        <div className='confidence'>
            <h2>Confidence Boosting Quotes from Inspirational Leaders</h2>
            <p className='confidence-quotes'>
                {listOfQuotes}

            </p>
        </div>
    )
}
